We all knew that Berinice will get into a penal institution if she keeps living so wildly and recklessly. Now, that it has happened, the guard, Bob Terminator wants to make sure that the pretty girl learns from the lesson and won't get into trouble anymore. To achieve that, he has all the right tools: his discipline, his rigor, and his big rod to punish the girl.
